import React, { useState } from "react";
import "./ProductCard.css";

const ProductCard = ({ bs_name, name, price, image }) => {
  return (
    <div className="container card">
      <div className="card_left">
        <a href="#">
          <i className="fa fa-long-arrow-left left" aria-hidden="true" />
        </a>
        <a href="#">
          <i className="fa fa-long-arrow-right right" aria-hidden="true" />
        </a>
        <img src={image} />
      </div>
      <div className="card_right">
        <span>{bs_name}</span>
        <h3>{name}</h3>
        <div className="card_footer">
          <span className="price">{price}</span>
          <a href="#" className="btn">
            buy now
          </a>
        </div>
      </div>
    </div>
  );
};

export default ProductCard;
